export function FooterGe(){
    return(
      <>
        <div className="footer_ge">
            <div className="footer_ge_top">
                <div className="footer_ge_top_container">

                </div>
            </div>
            <div className="footer_ge_center"></div>
            <div className="footer_ge_bottom"></div>
        </div>
      </>
    );
}
